        public static IEmote GetShipTierEmoji(UserShipTier tier) => tier == UserShipTier.Primary ? new Emoji("💗")
            : (tier == UserShipTier.Secondary ? new Emoji("💖") : new Emoji("♥"));
        public static string GetEmojiImage(string path, string target)
        {
            target = target.Trim();
            var length = DownloadedEmojis.GetLength(0);
            for (int i = 0; i < length; i++)
            {
                if (DownloadedEmojis[i, 0].Equals(target))
                {
                    return Path.Combine(path, DownloadedEmojis[i, 1]);
                }
            }
            return null;
        }

        public static bool HasCustomEmote(Emote emote, SocketCommandContext Context)
        {
            if (Context.Guild != null && Context.Guild.GetUser(Context.Client.CurrentUser.Id).GetPermissions(Context.Channel as IGuildChannel).Has(ChannelPermission.UseExternalEmojis))
            {
                // Bot does not have use external emoji privileges
                return Context.Guild.Emotes.Any(a => a.Id == emote.Id);
            }
            return Context.Client.Guilds.SelectMany(a => a.Emotes).Any(a => a.Id == emote.Id);
        }

        public static bool TryParseEmoji(string input, out Emoji result)
        {
            if (IsRegionalEmoji(input)
                || IsEmojiDownloaded(input))
            {
                result = new Emoji(input);
                return true;
            }

            var match = Regex.Match(input, EmojiPattern);
            if (match.Success && match.Value.Equals(input))
            {
                result = new Emoji(input);
                return true;
            }

            result = null;
            return false;
        }

        public static bool IsEmojiDownloaded(Emoji emoji) => IsEmojiDownloaded(emoji.ToString());
        public static bool IsEmojiDownloaded(string unicode)
        {
            var length = DownloadedEmojis.GetLength(0);
            for (int i = 0; i < length; i++)
            {
                if (DownloadedEmojis[i, 0].Equals(unicode))
                {
                    return true;
                }
            }
            return false;
        }


        public static readonly string CustomEmotePattern = @"<a?:[^:]*:[^>]*>";

        public static IEmote GetNumberEmote(int num)
        {
            if (num < 0 || num > 50)
                throw new IndexOutOfRangeException("Number emote to retrieve must be between 0 and 50");

            if (num <= 10)
                return new Emoji(NumberEmotes[num]);
            else
                return Emote.Parse(NumberEmotes[num]);
        }

